import React, { Component } from 'react';

class MainPage extends Component {
    render() {
        return (
            <div>
                <p>{this.props.googleName}</p>
                <p>{this.props.googleEmail}</p>
                <img src={this.props.googleImage} />
            </div>
        );
    }
}

export default MainPage;
